import { Box, IconButton, ShoppingCartIcon} from '@mui/material';
import StyledBadge from '@mui/lab/StyledBadge';

interface Props {
    totalItem: number;
    totalPrice: number;
}

const ShoppingCart = ({totalItem, totalPrice}: Props) => {
    return (
        <Box width="100%">
            <Box>
                <h3>Shopping Cart</h3>
                <IconButton aria-label="cart">
                <StyledBadge badgeContent={totalItem} color="secondary">
                    <ShoppingCartIcon />
                </StyledBadge>
                </IconButton>
            </Box>
            <Box>
                <h4>Total Price</h4>
                {totalPrice}
            </Box>
        </Box>
    )
}

export default ShoppingCart;
